	<text transform="matrix(1 0 0 1 657.0238 2982.0913)"><tspan x="0" y="0" class="st18 st43">Toru Bilash is a plant nursery that offers a </tspan><tspan x="0" y="15.6" class="st18 st43">wide range of plants, trees, and flowers for </tspan><tspan x="0" y="31.2" class="st18 st43">sale. With a team of knowledgeable staff, the </tspan><tspan x="0" y="46.8" class="st18 st43">nursery provides expert advice on plant selec</tspan><tspan x="260.22" y="46.8" class="st18 st43">-</tspan><tspan x="0" y="62.4" class="st18 st43">tion, care, and maintenance. They aim to </tspan><tspan x="0" y="78" class="st18 st43">promote environmental conservation and </tspan><tspan x="0" y="93.6" class="st18 st43">awareness by offering eco-friendly and sus</tspan><tspan x="246.58" y="93.6" class="st18 st43">-</tspan><tspan x="0" y="109.2" class="st18 st43">tainable plant options.</tspan></text>
	<rect x="1111.02" y="2972.79" class="st17" width="279.5" height="144.5"/>
	<text transform="matrix(1 0 0 1 1111.0238 2982.0913)"><tspan x="0" y="0" class="st18 st43">CHISAS is social organization that aims to </tspan><tspan x="0" y="15.6" class="st18 st43">improve the lives of disadvantaged children by </tspan><tspan x="0" y="31.2" class="st18 st43">providing them with access to education, health</tspan><tspan x="272.6" y="31.2" class="st18 st43">-</tspan><tspan x="0" y="46.8" class="st18 st43">care, and social services. The organization </tspan><tspan x="0" y="62.4" class="st18 st43">strives to promote child welfare and protection, </tspan><tspan x="0" y="78" class="st18 st43">particularly for vulnerable and marginalized </tspan><tspan x="0" y="93.6" class="st18 st43">children, through advocacy and community </tspan><tspan x="0" y="109.2" class="st18 st43">mobilization efforts.dedicated to helping poor </tspan><tspan x="0" y="124.8" class="st18 st43">communities by providing access to education, </tspan></text>
